sourcesContent:
const { createClient } = require('redis');

const client = createClient();

((async () => {
  try {
    await client.connect();
    console.log('Redis client connected to the server');
  } catch (error) {
    console.log(`Redis client not connected to the server: ${error.message}`);
  }
})());

